  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This release contains the Basic Stand
  Alone (BSA) Hospice Beneficiary Public Use Files (PUF) with information from Medicare
  hospice claims. The CMS BSA Hospice Beneficiary PUF is a beneficiary-level file
  in which each record is a beneficiary who had at least one hospice claim from a
  random 5 percent sample of Medicare beneficiaries. There are some demographic and
  claim-related variables provided in this PUF.</p>n\",\n\t\"owner_org\": \"3609164c-4c49-4a44-9179-23163027dc0a\",\n\t\"extras\":
